.page {
    max-height: inherit;
    min-height: 300px;
    overflow: auto;
    padding-bottom: 0.5em;
}

.page-wrapper {
    margin: 0 auto;
    overflow: visible;
}

.pull-left {
    float: left;
}

.pull-right {
    float: right;
}

.select {
    cursor: pointer;
}

    .select > :not(.selected) {
        display: none;
    }

.select-dropdown {
    background-color: #fff;
    box-shadow: 0 8px 10px 1px rgba(0,0,0,0.14),0 3px 14px 2px rgba(0,0,0,0.12),0 5px 5px -3px rgba(0,0,0,0.2);
    left: 0;
    min-width: 70px;
    max-height: 300px;
    z-index: 2000;
}

    .select-dropdown > div {
        padding: 8px 26px 8px;
        cursor: pointer;
    }

    .select-dropdown > div:hover {
        background-color: #eee;
    }

.row > div {
    display: inline-block;
    width: 50%;
}

    .row > div:nth-child(2n+1) {
        text-align: right;
        width: 50%;
    }

    .row > div:nth-child(2n+2) {
        text-align: left;
        width: 50%;
    }

.text-center {
    text-align: center
}

.text-lg {
    font-size: 15px;
}

.thirdparty-window {
    border: none;
    min-height: 250px;
    padding-right: 1px; /* Fixes border issue */
    width: 100%;
    width: -moz-available;
    width: -webkit-fill-available;
    width: fill-available;
}

.tml-prompt {
    margin-top: 0;
    padding-bottom: 0
}

.toggle-help:checked ~ .help-content {
    display: block;
    margin-top: 1em;
    opacity: 1;
    word-break: break-word;
}

.toggle-help:checked + .help-title .chevron {
    transform-origin: center;
    transition: transform 0.5s;
    transform: rotateZ(-135deg);
}

.w-max {
    width: 100%;
}

@media (min-width: 550px) {
    .page-wrapper {
        max-width: 500px;
    }
}

@media (max-height: 549px) {
    .oob-status .circle {
        width: 78px;
        height: 78px;
    }

    #spinner_group circle {
        stroke-dasharray: 244; /* (3.14 * .oob-status .circle width); */
        animation: spinner-98 4s linear infinite;
    }
}

@media (min-height: 550px) {
    .oob-status .circle {
        width: 96px;
        height: 96px;
    }

    #spinner_group circle {
        stroke-dasharray: 301;
        animation: spinner-116 4s linear infinite;
    }
}

@media (min-height: 600px) {
    .oob-status .circle {
        width: 110px;
        height: 110px;
    }

    #spinner_group circle {
        stroke-dasharray: 345;
        animation: spinner-130 4s linear infinite;
    }
}

@media (min-height: 800px) {
    .oob-status .circle {
        width: 130px;
        height: 130px;
    }

    #spinner_group circle {
        stroke-dasharray: 408;
        animation: spinner-150 4s linear infinite;
    }
}

